import React from 'react';

import './custom-button.styles.scss';

const CustomButton = ({ children, isInverted, isGoogleSignIn, ...otherProps }) =>{

    return(
        <button 
            className={`
                ${isInverted ? 'inverted' : ''} 
                ${isGoogleSignIn ? 'google-sign-in' : ''} 
                custom-button`} 
                {...otherProps}
            >
            {children}
        </button>
    );
};

export default CustomButton;
